import React from "react";
import RecipeItem from './RecipeItem';

function RecipeList({ recipes, deleteRecipe }) {


  return (
    <div className="recipe-list">
      <table>
        <thead>
          <th>Name</th>
          <th>Cuisine</th>
          <th>Photo</th>
          <th>Ingredients</th>
          <th>Preparation</th>
          <th>Actions</th>
          {recipes.map((recipe, index) => (
            <tr key={index}>
              <RecipeItem recipe={recipe} />
            </tr>
          ))} 
        </thead>
        <tbody>

        </tbody>
      </table>
    </div>
  );
}

export default RecipeList;
